            'key_highlight4_title' => 'Post-Treatment Benefits',
            'key_highlight4_description' => 'Follow-up care via teleconference, videoconference, email, Skype, & FaceTime to receive continued information on recovery & aftercare.',
            'virtual_tour_text' => 'Have a look at the infrastructure and facilities provided by STAR Hospitals, Hyderabad, to care for International Patients.',
            'our_process_text' => 'STAR Hospitals offers exceptional medical care and support services to patients from all over the world. With leading doctors from the field of medicine and surgery, we provide international patients with the highest standard of medical care and treatments tailored to suit the unique needs of our patients. Here is how you can avail the medical facilities at STAR Hospitals.',
            'facilities_text' => 'With state-of-the-art facilities, our team of doctors provide round-the-clock medical support, delivering comprehensive care to our international patients. With the proper care and treatment, you can trust STAR Hospitals with your distinctive healthcare requirements.',
            'reviews_text' => 'At STAR Hospitals, we always work towards making our patients happy and comfortable throughout their medical journey. You can trust us with our patient-centric approach for all your healthcare needs. Here is what some of our international patients have to say about us.',
            'enquiry_form_text' => 'If you have any further queries about the medical services or facilities we provide for our international patients, fill out the inquiry form to contact our medical staff for guidance.',
            'faq_text' => 'Here are some common questions our international patients ask us.'
        ]);
